import React, {useEffect, useRef, useState} from "react";
import QRCodeStyling from "qr-code-styling";


export default function  QRCustom(props)
{
    // console.log(props.qroptions)
    // console.log(props.width,props.height,props.qroptions)
    if(props.width !== undefined)
    {
        props.qroptions.width=props.width
    }
    if(props.height !== undefined)
    {
        props.qroptions.height=props.height
    }
    // // console.log(props.Oup_url !== undefined , props.qroptions.data !== props.Oup_url )
    if(props.Oup_url !== undefined && props.qroptions.data !== props.Oup_url )
    {
        props.qroptions.data=props.Oup_url
        // console.log("hhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhh")
    }
    props.qroptions.margin=0
    // props.qroptions.image="data:image/png;base64,"

    // props.qroptions.image="data:image/jpeg;base64,"
    const [qrCode] = useState(new QRCodeStyling(props.qroptions));
    const ref = useRef(null);

    useEffect(() => {
        if (ref.current) {
            qrCode.append(ref.current);
        }
    }, [qrCode, ref]);

    useEffect(() => {
        if (!qrCode) return;
        qrCode.update(props.qroptions);
    }, [qrCode, props.qroptions]);


    return<>
        <div className="canvas"  ref={ref} style={{width: "fit-content",height: "fit-content",border:""}} ></div>
    </>
}